import { images, useWindowDimensions } from '../constants'

function PushImage() {
  const { height, width } = useWindowDimensions()
  return (
    <div
      style={{
        flex: 1,
        backgroundColor: '#17191f',
      }}
    >
      <div
        style={{
          display: 'flex',
          height: height * 0.09,
          backgroundColor: '#171544',
          flexDirection: 'row',
        }}
      >
        <img
          src={'https://i.imgur.com/hPbfzZ2.png'}
          alt="Logo image T&C"
          style={{
            height: height * 0.09 - 26,
            marginTop: 13,
            marginBottom: 13,
            marginLeft: 10,
            marginRight: 13,
          }}
        />
      </div>
    </div>
  )
}
export default PushImage
